import React, { forwardRef, ForwardedRef } from 'react'

export type Props = {}

const LargeOrangeSquare = forwardRef(
  (props: Props, ref: ForwardedRef<HTMLElement>) => {
    const { ...otherProps } = props

    return (
      <figure ref={ref} {...otherProps}>
        <img
          alt=""
          src="data:image/png;base64,&#x3D;"
        />
      </figure>
    )
  }
)

LargeOrangeSquare.displayName = 'LargeOrangeSquare'
LargeOrangeSquare.defaultProps = {}

export default LargeOrangeSquare
